import React from 'react';
import ReactDOM from 'react-dom/client';
import Header from './components/Header';
import Footer from './components/Footer';
import './utils/global-style.scss'
import Home from './pages/Home';
import SignIn from './pages/SignIn';
import User from './pages/User';
import Error from './pages/Error';
import { ProviderComponent } from 'react-redux';
import store from './utils/store'
import { BrowserRouterComponent } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <ProviderComponent store={store}>
  <BrowserRouterComponent>
    <Header />
    <RoutesComponent>
      <RouteComponent exact path="/" element={<Home />} />
      <RouteComponent path="/signIn" element={<SignIn />} />
      <RouteComponent path="/user" element={<User />} />
      {/* Conditional render for the error page */}
      <RouteComponent path="*" render={(props) => {
        throw new Error('An unexpected error occurred.');
      }} />
    </RoutesComponent>
    <Footer />
  </BrowserRouterComponent>
</ProviderComponent>
);
